// We require the Hardhat Runtime Environment explicitly here. This is optional
// but useful for running the script in a standalone fashion through `node <script>`.
//
// You can also run a script with `npx hardhat run <script>`. If you do that, Hardhat
// will compile your contracts, add the Hardhat Runtime Environment's members to the
// global scope, and execute the script.
require("@nomiclabs/hardhat-web3");

const hre = require("hardhat");
const ethers = require("ethers");
async function main() {
  const [owner] = await hre.ethers.getSigners();
  console.log(await owner.getAddress())
  const SlashTokenDrop = await hre.ethers.deployContract("SlashToken");
  const slashTokenDrop = await SlashTokenDrop.waitForDeployment();
  const ERC20 = await hre.ethers.deployContract("DummyErc20");
  const erc20 = await ERC20.waitForDeployment();
  const ERC721 = await hre.ethers.deployContract("DummyErc721");
  const erc721 = await ERC721.waitForDeployment();
  console.log(await slashTokenDrop.getAddress())
  console.log(await erc20.getAddress())
  console.log(await erc721.getAddress())
  // const slashTokenDrop = await hre.ethers.getContractAt("SlashToken", '0x6c75dD78EBEde531a7D5A778054bA2f6f48fd2F6');
  let txn = await slashTokenDrop.initialize('0x4E046429524e6840406EDe6B4eE87b3CF0165BE3', '0x3C06A47B3F3321Fa4A80Ca6148EaD88994F282c9', 3000000000000n, [5, 10, 30], [12000000000000n, 21000000000000n, 45000000000000n])
  await txn.wait()
  // const erc20 =  await hre.ethers.getContractAt("DummyErc20", '0xB483a3be0E7d9C776c3b12eDA62aD62Ca78D9c10');
  // const erc721 =  await hre.ethers.getContractAt("DummyErc721", '0x8dbBDF3E784c892EE006DADF0b93622eD893c546');
  txn = await erc20.mint(10000000000n, '0x51A10B7CDaaa6FB6ED25b95D5c979E82CCb748e2')
  await txn.wait()
  txn = await erc721.mint(100, '0x51A10B7CDaaa6FB6ED25b95D5c979E82CCb748e2')
  await txn.wait()
  txn = await slashTokenDrop.handleErc721Flag(1)
  await txn.wait()
}


// We recommend this pattern to be able to use async/await everywhere
// and properly handle errors.
main().catch((error) => {
  console.error(error);
  process.exitCode = 1;
});

